import { useState,useEffect } from 'react';
const Codeforces = () => {

const[subs,setSubs]=useState("");
con

    useEffect(()=>{

        fetch(`https://codeforces.com/api/user.status?handle=Fefer_Ivan`)
        .then(res => res.json())
        .then(data=>(

          setSubs(data.result.length)

          ))

      },[])

  return (


    <div>
        <p>submissions={subs}</p>
    </div>
  )
}

export default Codeforces
